import React, { useState, useEffect } from "react";
import logo from "./images/logo.svg";
import kyle from "./images/kyle-bowtie.jpg";
import "./App.css";
import Banner from "./Banner";

function HeadShot() {
  <div id="head-shot-container">
    <img src={kyle} alt="head-shot" />
  </div>
}

function Home() {
  return (
    <HeadShot />
  );
}

export default Home;
